import { render } from "@testing-library/react";
import React from "react";

const Necas = ({ text }) => {
  render();
  {
    const items = [];

    text.Search.map((t) => items.push(<li>{`Coiso ${t.Title}`}</li>));
  }
  console.log(items);
  return <div>{items}</div>;
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
